import React, { Component } from 'react';
import '../App.css';

export default class Blog extends Component {
    render() {
        console.log(this.props);
        return(
            <div className="Blog">
                <img src={this.props.newImg}></img>
                {this.props.newTime}
                {this.props.newTitle}
                {this.props.newCate}
                {this.props.newTitle}
                {this.props.newContent}
                zxc
            </div>
        )
    }
}
